pport to these kids. We believe that every child has the right to seek education and if he or she finds hindrance in doing so we at Pahadi Dagdya are there to help those kids by providing them with Books, Paying their Tution Fee, Providing them with uniform and shoes. Our aim is to overcome all obstacles that come in the way of these kids and their development. Pahadi Dagdya means friend from the Hills, and just like any good friend we offer support of every kind to ensure the growth &amp; development of our tiny little friends.','Welcome to Pahadi Dagdya group','','inherit','closed','closed','','6-revision-v1','','','2017-01-08 06:56:27','2017-01-08 01:26:27','',6,'http://pahadidagdya.com/?p=623',0,'revision','',0),(625,1,'2017-01-08 06:59:35','2017-01-08 01:29:35','&nbsp;\r\n\r\nPahadi Dagdya is an organization that finds its roots in the beautiful &amp; serene mountains of Uttarakhand. What was started by 4 friends as a voluntary effort to help the economically deprived children of our homeland, is today a not-for-profit organization that is joined by 127 people who share the vision to provide support to these kids. We believe that every child has the right to seek education and if he or she finds hindrance in doing so we at Pahadi Dagdya are there to help those kids by providing them with Books, Paying their Tuition Fee, Providing them with uniform and shoes. Our aim is to overcome all obstacles that come in the way of these kids and their development. Pahadi Dagdya means friend from the Hills, and just like any good friend we offer support of every kind to ensure the growth &amp; development of our tiny little friends.','Welcome to Pahadi Dagdya group','','inherit','closed','closed','','6-revision-v1','','','2017-01-08 06:59:35','2017-01-08 01:29:35','',6,'http://pahadidagdya.com/?p=625',0,'revision','',0),(626,1,'2017-01-08 07:03:09','2017-01-08 01:33:09','[gallery ids=\"619,618,617,616,615,614,613,612,611,610,609,608,607,606,605,604,603,602,601,600,599,598,59