:29','','Anthwal School Tehri','','inherit','closed','closed','','14409447_301564623543816_5394928533151109319_o','','','2017-03-29 22:33:43','2017-03-29 17:03:43','',828,'http://pahadidagdya.com/wp-content/uploads/2017/03/14409447_301564623543816_5394928533151109319_o.jpg',0,'attachment','image/jpeg',0),(852,1,'2017-03-29 22:34:56','2017-03-29 17:04:56','<div id=\"js_6nz\" class=\"_5pbx userContent\" data-ft=\"{&quot;tn&quot;:&quot;K&quot;}\">\r\n<div id=\"id_58da9234c48f37c73092420\" class=\"text_exposed_root text_exposed\">\r\n\r\n                        ,                           \r\n\r\n ,      \" \" (a sub Group of Garhwali Brahmin)  ,          5    \r\n\r\n             Pankaj Naithani    <span class=\"text_exposed_show\">       \r\n         ,                        </span>\r\n<div class=\"text_exposed_show\">\r\n\r\n            ,                        \r\n\r\n  <span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span>\r\n  <span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span>\r\n\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"_3x-2\">&nbsp;[ngg_images source=\"galleries\" container_ids=\"45\" sortorder=\"253,249,251,252,254,255,257,256,250,258\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Anthwal School Tehri\" template=\"default\" slug=\"Anthwal-School-Tehri\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]</div>','Pahadi DAGDYA at Anthwal School, Tehri.','','inherit','closed','closed','','828-revision-v1','','','2017-03-29 22:34:56','2017-03-29 17:04:56','',828,'http://pahadidagdya.com/?p=852',0,'revision','',0),(853,1,'2016-08-29 22:36:17','2016-08-29 17:06:17','We decided that we will transfer money approximately 6000 rupees for kids suggested by CHAMOLI ji as weather is not permitting volunteers to go dere .\r\n\r\nKids suggested by Rathi ji also approved of help around 9000+ expense, but volunteer still to be decided who will go with him .\r\n<div class=\"text_exposed_show\">\r\n\r\nWe will make banner with the logo of PAHADI DAGDYA For FUTURE school visits .\r\nPatwal ji will do the needful for banner if anybody else can do that please come forward as Patwal ki last few days are not in best of health .\r\n\r\nToday\'s meeting achievement was one more senior sh. Subhash Thapliyal ji discovery though he has attended our previous meetings as a silent spectator but today he spoke about his doubts and then gave some suggestions.\r\n\r\n1. All previous meetings attendance , contributions and MOM need to be recorded .\r\n2. We should try to help out kids of 10 plus level .\r\n3. In follow up to our help we should award the kids who perform excellent with some prizes to motivate them .\r\n\r\nV r planning to get some note books with our logo printed on the back of note books.\r\n\r\nAshish suggested to finish all help of this season by October and then just keep working on list of new kids but they will be helped in new academic session .\r\nRegistration work is pending as documents of two office bearers needs to be submitted.\r\nThe collection for the day with was 14100 rupees .\r\n\r\nT. R. Dhondhiyal sir again took responsibility of making a file for all our documents, documents submitted by Ashish\'s two visits to Garhwal handed over to him.sir you are gem of our group .\r\n\r\nLast but not the least I would really thank all our seniors who made it to meeting and also welcome new members SANDEEP and Naveen ji.\r\n\r\nThapliyal ji against the all odds of his mom admitted to hospital came to give his most precious presence to meeting, kitna bhi appreciate karein kum hai .<span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span><span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span><span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span><span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span><span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span><span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span>.\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"46\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Monthly Meeting Aug 2017\" template=\"default\" slug=\"Monthly-meeting-Aug-2017\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]</div>','Monthly Meeting 28th August 2016','','publish','closed','closed','','monthly-meeting-28th-august-2016','','','2017-03-