LI ji as weather is not permitting volunteers to go dere .\r\n\r\nKids suggested by Rathi ji also approved of help around 9000+ expense, but volunteer still to be decided who will go with him .\r\n<div class=\"text_exposed_show\">\r\n\r\nWe will make banner with the logo of PAHADI DAGDYA For FUTURE school visits .\r\nPatwal ji will do the needful for banner if anybody else can do that please come forward as Patwal ki last few days are not in best of health .\r\n\r\nToday\'s meeting achievement was one more senior sh. Subhash Thapliyal ji discovery though he has attended our previous meetings as a silent spectator but today he spoke about his doubts and then gave some suggestions.\r\n\r\n1. All previous meetings attendance , contributions and MOM need to be recorded .\r\n2. We should try to help out kids of 10 plus level .\r\n3. In follow up to our help we should award the kids who perform excellent with some prizes to motivate them .\r\n\r\nV r planning to get some note books with our logo printed on the back of note books.\r\n\r\nAshish suggested to finish all help of this season by October and then just keep working on list of new kids but they will be helped in new academic session .\r\nRegistration work is pending as documents of two office bearers needs to be submitted.\r\nThe collection for the day with was 14100 rupees .\r\n\r\nT. R. Dhondhiyal sir again took responsibility of making a file for all our documents, documents submitted by Ashish\'s two visits to Garhwal handed over to him.sir you are gem of our group .\r\n\r\nLast but not the least I would really thank all our seniors who made it to meeting and also welcome new members SANDEEP and Naveen ji.\r\n\r\nThapliyal ji against the all odds of his mom admitted to hospital came to give his most precious presence to meeting, kitna bhi appreciate karein kum hai .<span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span><span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span><span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span><span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span><span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span><span class=\"_5mfr _47e3\"><img class=\"img\" src=\"https://www.facebook.com/images/emoji.php/v8/f1f/2/16/1f64f.png\" alt=\"\" width=\"16\" height=\"16\"><span class=\"_7oe\">?</span></span>.\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"46\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Monthly Meeting Aug 2017\" template=\"default\" slug=\"Monthly-meeting-Aug-2017\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]</div>','Monthly Meeting 28th August 2016','','inherit','closed','closed','','853-revision-v1','','','2017-03-29 22:39:32','2017-03-29 17:09:32','',853,'http://pahadidagdya.com/?p=859',0,'revision','',0),(860,1,'2016-07-22 22:41:03','2016-07-22 17:11:03','The meeting was again proved to be a milestone for our GB as there were official as well as some personal CHEERFUL NEWS for PD MEMBERS\r\n\r\n1. While, Shri Tejram Dhoundiyal ji came forward and took responsibility of registering our society with the help of his personal CA. In the meeting other member has also spoken to CA. Very soon or before Independence Day we will get registered .\r\n<div class=\"text_exposed_show\">\r\n\r\n2. Ashish Sundriyal ji shared his experience of both the schools where he went to provide help to needy students. He has done incredible job in spite of bad weather conditions in Uttrakhand. Cheers and kudos to Ashish ji. Now we have a new enthusiast Akhilesh Nauriyal ji who volunteered for the next trip which is inspiring and great news for our group.\r\n\r\n3. Suresh Badola JI our one of the old members rejoined us as due to his busy schedule he was not able to attend meeting but now he promised us give his maximum time and shared his experience of forming society his inputs and participation is valuable and will be great help .\r\n\r\n4. Another cheerful news was that 15 members attended the meeting and collection was also quite good .it was in excess of Rs.10,800. We will put bank details soon .\r\n\r\n5. Ashish Lakhera JI has taken PD\'s work on war footing as he is continuously getting donation from non PD members and officially he is trying to list PD IN CSR so that PD will get regular donations from his company . We all can try some sort of this thing .\r\n\r\n6. One more thing was decided that instead of third Sunday the meeting will be held on 2nd or 4th Sunday. We will soon put decision after discussion.\r\n\r\n7. I am happy to announce that two of our members, Ashish Lakhera ji and Ms. Anita Bhat got engaged to each other and happily announced the friendly relation transforming into personal relation ,I am sharing this news as to point out here that our bonding and faith within the PD is getting so strong that we taking our friendly and personal relation on a strong level\r\n\r\n8. Last but not the least I would like to thank all the members who attended the meet in the rainy season and promised that they will make it a habit.\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"47\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Monthly Meeting Jul 2016\" template=\"default\" slug=\"Monthly-meeting-jul-2016\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]</div>','Monthly Meeting Jul 2016','','publish','closed','closed','','monthly-meeting-jul-2016','','','2017-03-29 22:43:40','2017-03-29 17:13:40','',0,'http://pahadidagdya.com/?p=860',0,'post','',0),(861,1,'2017-03-29 22:41:49','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_gallery','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-03-29 22:41:49','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9',0,'http://pahadidagdya.com/?p=861',0,'ngg_gallery','',0),(862,1,'2017-03-29 22:41:49','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_pictures','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-03-29 22:41:49','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9',0,'http://pahadidagdya.com/?p=862',0,'ngg_pictures','',0),(863,0,'2017-04-30 22:40:12','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_pictures','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-04-30 22:40:12','2017-04-30 17:10:12','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9',0,'http://pahadidagdya.com/?p=863',0,'ngg_pictures','',0),(864,1,'2017-03-29 22:41:49','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_gallery','','draft',