y he is trying to list PD IN CSR so that PD will get regular donations from his company . We all can try some sort of this thing .\r\n\r\n6. One more thing was decided that instead of third Sunday the meeting will be held on 2nd or 4th Sunday. We will soon put decision after discussion.\r\n\r\n7. I am happy to announce that two of our members, Ashish Lakhera ji and Ms. Anita Bhat got engaged to each other and happily announced the friendly relation transforming into personal relation ,I am sharing this news as to point out here that our bonding and faith within the PD is getting so strong that we taking our friendly and personal relation on a strong level\r\n\r\n8. Last but not the least I would like to thank all the members who attended the meet in the rainy season and promised that they will make it a habit.\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"47\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Monthly Meeting Jul 2016\" template=\"default\" slug=\"Monthly-meeting-jul-2016\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]</div>','Monthly Meeting Jul 2016','','inherit','closed','closed','','860-revision-v1','','','2017-03-29 22:43:40','2017-03-29 17:13:40','',860,'http://pahadidagdya.com/?p=866',0,'revision','',0),(867,1,'2016-04-29 22:47:20','2016-04-29 17:17:20','<strong>\'INTER COLLEGE JAKHETI</strong>   9        ( , , )  \r\n\r\n  -                 ,,            \r\n\r\n               (including Exam Fee)   \r\n<div class=\"text_exposed_show\">\r\n\r\n           \r\n\r\n[ngg_images source=\"galleries\" container_ids=\"48\" sortorder=\"265,261,262,263,264,266,267\" display_type=\"photocrati-nextgen_basic_thumbnails