ool Principals in front of Student\'s Guardian.\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"50\" sortorder=\"283,282,284,285,286,287,288,289,290,291,292,293,294,295,296,297,298\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"2ndMileStone\" template=\"default\" slug=\"2nd-Mile-Stone\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]','2nd Milestone of Pahadi Dagdya','','inherit','closed','closed','','919-revision-v1','','','2017-03-29 23:03:28','2017-03-29 17:33:28','',919,'http://pahadidagdya.com/?p=957',0,'revision','',0),(958,1,'2017-03-29 23:20:27','2017-03-29 17:50:27','Pahadi Dagdya has reached 11 schools in Uttarakhand and helped 49 economically deprived kids by providing them aid for education. These are the number of students we have helped in different areas of Uttarakhand.\r\n\r\n<strong>Make&nbsp;Donation :-</strong>&nbsp;We ourselves feel that what we are doing is just a drop in the ocean. But if that drop was not in the ocean, I think the ocean would be less because of that missing drop. I do not agree with the big way of doing things, so please make donation as much you can.\r\n\r\n&nbsp;\r\n\r\n<strong>BANK ACCOUNT DETAILS OF PAHADI DAGDYA</strong>\r\n\r\n<!--<strong><a href=\"https://www.instamojo.com/@pahadidagdya/\" target=\"_blank\">Donate Now</a></strong>-->\r\nBranch-Garh Road .Meerut .UP\r\nA/C No 653501011001096\r\nType of A/C -Current AC\r\nIFSC code VIJB0006535','Make Donation','','inherit','closed','closed','','336-revision-v1','','','2017-03-29 23:20:27','2017-03-29 17:50:27','',336,'http://pahadidagdya.com/?p=958',0,'revision','',0),(959,1,'2016-07-09 08:08:11','2016-07-09 02:38:11','Proud to announce that PAHADI DAGDYA is doing an activity today in chaubattakhal constituency, District Pauri Garhwal.\r\nWe have pointed out 2 Schools today and have already distributed school dress, notebooks, shoes and paid the yearly fees of some needy students in one school at Laachi.\r\nSpecial thanks to our motivator Shri Ashish Sundriyal ji who has taken a leave from his office for giving back to our Uttarakhand Society. \r\nHope his work will become a milestone and other members will soon follow his footstep.\r\nJAI BADRI VISHAL!\r\n[ngg_images source=\"galleries\" container_ids=\"51\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Lachhi-School\" template=\"default\" slug=\"Lachhi-School\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]','Pahadi Dagdya - Laachi School, Pauri Garhwal.','','publish','closed','closed','','pahadi-dagdya-laachi-school-pauri-garhwal','','','2017-03-30 08:14:57','2017-03-30 02:44:57','',0,'http://pahadidagdya.com/?p=959',0,'post','',0),(960,1,'2017-03-30 08:12:55','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_gallery','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-03-30 08:12:55','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9',0,'http://pahadidagdya.com/?p=960',0,'ngg_gallery','',0),(961,1,'2017-03-30 08:12:55','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_pictures','','draft','closed','closed','','mixin_nextgen_table_extras','','','2017-03-30 08:12:55','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9',0,'http://pahadidagdya.com/?p=961',0,'ngg_pict