rder_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]','  9  2017','','inherit','closed','closed','','1123-autosave-v1','','','2017-05-11 22:46:31','2017-05-11 17:16:31','',1123,'http://pahadidagdya.com/?p=1181',0,'revision','',0),(1182,1,'2017-05-11 22:46:34','2017-05-11 17:16:34','  <a href=\"https://www.facebook.com/pankaj.naithani.33\">  </a>        9  2017           Inter College,   25            \r\n         \r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n[ngg_images source=\"galleries\" container_ids=\"56\" sortorder=\"362,357,374,358,360,361,363,364,365,366,367,368,369,370,371,372,373,375,377,378,379,380,376,359\" display_type=\"photocrati-nextgen_basic_thumbnails\" override_thumbnail_settings=\"1\" thumbnail_width=\"240\" thumbnail_height=\"180\" thumbnail_crop=\"1\" images_per_page=\"10\" number_of_columns=\"0\" ajax_pagination=\"1\" show_all_in_lightbox=\"0\" use_imagebrowser_effect=\"1\" show_slideshow_link=\"1\" slideshow_link_text=\"Palethi\" template=\"default\" slug=\"Palethi\" order_by=\"sortorder\" order_direction=\"ASC\" returns=\"included\" maximum_entity_count=\"500\"]','  9  2017','','inherit','closed','closed','','1123-revision-v1','','','2017-05-11 22:46:34','2017-05-11 17:16:34','',1123,'http://pahadidagdya.com/?p=1182',0,'revision','',0),(1183,1,'2017-05-14 21:36:38','2017-05-14 16:06:38','[gallery ids=\"645,644,632,630,633,635,637,642,643\"]\r\n\r\n<center><b>He who opens a school door, closes a prison.  Victor Hugo</b></center>\r\nPahadi Dagdya - friend from the Hills, is opening that school door for all the economically deprived children of Uttarakhand . It was started by 4 friends as a voluntary effort and now has joined by 127 other friends. Pahadi Dagdya, so far has reached out 93 children of 13 schools of Pauri and Tehri Garhwal by providing them with fees, bags, books and uniforms.\r\n\r\nDoubtless, education is the most powerful catalyst for social transformation. But child education cannot be done in isolation. A child will go to school only if the family income is good. Realizing this, Pahadi Dagdya, beginning in the corridors of education, adopted a lifecycle approach of development by providing the child with financial aid so that he or she can come to school.\r\n\r\nThis poverty damages childhood with significant effects on a childs physical and mental health, as well as educational achievement. It limits the expectations of the childs ability to perform well in school,. For this reason, Pahadi Dagdya also identifies and encourages the dropouts to continue their education.\r\n\r\nThe poor and underprivileged kids lag at all stages of education. When earning a livelihood and taking care of the members of the family becomes a primary matter of concern in ones life, education stands a little or, very often, no chance of pursuance. For many underprivileged children education is a high-priced luxury, So, Pahadi dagdya took an initiative for providing assistance to these kids. It has already helped 93 such kids.\r\n\r\nIt believes that unless members of the civil society are involved proactively in the process of development, sustainable change will not happen. Following this model of Civic Driven Change, Pahadi Dagdya sensitizes and engages the civil society by holding valuable meetings wherever and whenever possible on important issues.\r\nIt is also equipped with its own newsletter which can elaborate upon the news related to its latest achievement, ongoing work and future projects. Moreover, Pahadi Dagdya is gathering attention over social platforms as it actively shares the eye catching and important information regarding Uttarakhand and their people which is liked by many.\r\nToday, 8 million children in India are out of school  surrounded by poverty and despair; they are fighting a daily battle for their education. Pahadi Dagdya wants to bring hope in their lives. So lets be together and bring a change and make it last.','We Support Child Education','','inherit','closed','closed','','6-revision-v1','','','2017-05-14 21:36:38','2017-05-14 16:06:38','',6,'http://pahadidagdya.com/?p=1183',0,'revision','',0),(1184,1,'2017-05-21 15:35:00','0000-00-00 00:00:00','','Auto Draft','','auto-draft','closed','closed','','','','','2017-05-21 15:35:00','0000-00-00 00:00:00','',0,'http://pahadidagdya.com/?p=1184',0,'post','',0);
